import React, { useState } from "react";
import {
    DropdownMenu,
    DropdownItem,
    DropdownDivider,
    Dropdown,
  } from 'semantic-ui-react';
  import 'semantic-ui-css/semantic.min.css';

  const options = [
    { key: 1, text: 'Choice 1', value: 1 },
    { key: 2, text: 'Choice 2', value: 2 },
    { key: 3, text: 'Choice 3', value: 3 },
  ]

function PortfolioDropdown(){
    const ls = {1:"a" , 2:"b" , 3:"c"}

    let list_menu = [];

    Object.entries(ls).map(entry => {
        let label = entry[0];
        let link = entry[1];
        list_menu.push(
            <DropdownItem>
                <a href={link}>{label}</a>
            </DropdownItem>
        )
    })


    return (
      <Dropdown text='File'>
        <DropdownMenu>
          {
            list_menu
          }       
        </DropdownMenu>
      </Dropdown>
    )
}

export default PortfolioDropdown;
